import {useState} from "react";

let lc_search = "";

function SearchBarOnClick(text) {
	// Replace with code to search a verse.
	lc_search = text;
	console.debug("Searched term: " + lc_search);
}

function SearchBar() {
	const [search_term, SetSearchTerm] = useState("");
	return (
		<div>
			<input type="search" id="bible_search" name="bible_search" onChange={event => {SetSearchTerm(event.target.value)}}></input>
			<button onClick={search_term => {SearchBarOnClick(search_term)}}>Search</button>
		</div>
		);
}
export default SearchBar;
